import Colors from "./colors";
const Dividers = {
  d10: {
    borderBottomWidth: 1,
    borderColor: Colors.grey60
  },
  d20: {
    borderBottomWidth: 8,
    borderColor: Colors.grey70
  }
};
export default Dividers;
